import React, { Component } from 'react';
import { items } from './ProductFeed.js';
import './Grid.css';

class Grid extends Component {
    render() {
        return (
            <div>
                <div className="row grid">
                    <div className="col-md-4 grid-item">
                        {items.itemcode}
                    </div>
                </div>
            </div>
        )
    }
}

export default Grid;
